import React, { useState } from 'react';

const Leaderboard = () => {
  const [players, setPlayers] = useState([
    { id: 1, name: 'Player 1', points: 100 },
    { id: 2, name: 'Player 2', points: 80 },
    { id: 3, name: 'Player 3', points: 120 },
    { id: 4, name: 'Player 4', points: 90 },
    { id: 5, name: 'Player 5', points: 110 },
    { id: 6, name: 'Player 6', points: 70 },
    { id: 7, name: 'Player 7', points: 130 },
    { id: 8, name: 'Player 8', points: 85 },
  ]);

  const numCols = Math.ceil(players.length / 5);
  const cols = Array.from({ length: numCols }, (_, i) =>
    players.slice(i * 5, i * 5 + 5)
  );

  return (
    <div>
      <h2>Leaderboard</h2>
      <div style={{ display: 'flex' }}>
        {cols.map((col, colIndex) => (
          <div key={colIndex} style={{ flex: 1, marginRight: '20px' }}>
            <table>
              <thead>
                <tr>
                  <th>Rank</th>
                  <th>Name</th>
                  <th>Points</th>
                </tr>
              </thead>
              <tbody>
                {col.map((player, index) => (
                  <tr key={player.id}>
                    <td>{colIndex * 5 + index + 1}</td>
                    <td>{player.name}</td>
                    <td>{player.points}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Leaderboard;
